import { useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [todos, setTodos] = useState([]);
  useEffect(() => {
    axios
      .get('http://jsonplaceholder.typicode.com/posts?_start=1&_limit=10')
      .then((response) => 
      setTodos(response.data)
      )
      .catch((error) => console.log(error));
  },[]);



  return (
    <div className="App">
      <div className="card">
        <ul>
      {todos.map((todo) =><>

          <li key={todo.id}>{todo.title}</li>
          <span>{todo.complete}</span>
      </> 
      )}
        </ul>
      </div>
    </div>
  );
}

export default App;
